import React from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import { Container, Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

import Button from '../components/Button';
import StyledCard from '../components/StyledCard';

import { addToCounter, subtractFromCounter } from '../redux/actions/counter';
import { selectRocket } from '../redux/actions/rocket';
import { selectLaunches } from '../redux/actions/launches';

const useStyles = makeStyles({
  container: {
    width: '90%',
    margin: '5%',
    backgroundColor: 'E1E1E1'
  },
  title: {
    paddingBottom: '50px'
  }
});

const selectRocketHelper = async rocketId => {
  console.log("entered")
  await selectRocket(rocketId);
}

const HomePage = ({ count, rocket, launches, incrementCount, decrementCount, selectRocket, selectLaunches }) => {

  const classes = useStyles();

  return (
    <React.Fragment>
      <Container className={classes.container}>
        <Grid container direction="row">
          <Grid className={classes.title} item align="left" xs={12} sm={12} md={8} lg={8}>
            <h1>SpaceX Rockets</h1>
          </Grid>
          <Grid className={classes.title} item align="left" xs={12} sm={2} md={2} lg={2}>
            <h1>Search</h1>
          </Grid>
          <Grid className={classes.title} item align="left" xs={12} sm={12} md={12} lg={12}>
            <h1>{rocket} Missions</h1>
          </Grid>
          <Grid item align="left" xs={12} sm={12} md={12} lg={12}>
            <StyledCard rocketName="Falcon 1" type="Merlin A" details="Details" location="Location" launchDate="Launch Date" />
          </Grid>
        </Grid>
          <Button
            onClick={() => {
              incrementCount();
            }}
            title="Increment Count"
          />
          <Button
            onClick={() => {
              decrementCount();
            }}
            title="Decrement Count"
          />
          <Button
            onClick={() => {
              selectRocketHelper("falcon1");
              console.log(rocket)
              selectLaunches(rocket);
            }}
            title="Select Falcon 1"
          />
          <Button
            onClick={() => {
              selectRocketHelper("falcon9");
              selectLaunches(rocket);
            }}
            title="Select Falcon 9"
          />
          Your current count is {count}
          Your current rocket is {rocket}
          Your current launches is {launches}
          <Link
            to="/test"
          >
          To Test Page
          </Link>
        </Container>
    </React.Fragment>
  )
}

const mapStateToProp = (state) => {
  const { counter, rocket, launches } = state;
  return {
    count: counter.count,
    rocket: rocket.rocketId,
    launches: launches.launches,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    incrementCount: () => {
      dispatch(addToCounter());
    },
    decrementCount: () => {
      dispatch(subtractFromCounter());
    },
    selectRocket: rocketId => {
      dispatch(selectRocket(rocketId))
    },
    selectLaunches: rocketId => {
      dispatch(selectLaunches(rocketId))
    },
  }
}

export default connect(mapStateToProp, mapDispatchToProps)(HomePage);
